const titleStyles={
    color:'orange',
    display:'flex',
    alignItem:'center',
    justifyContent: 'center',
    textTransform: 'uppercase',
    fontSize:'45px',
    fontWeight: 'bold',
    marginBottom: '10px'
};

const subtitleStyles={
  display:'flex',
  alignItem:'center',
  justifyContent: 'center',
  textAlign:'center',
  fontWeight:'300',
  fontSize:'22px',
  marginLeft:'250px',
  marginRight:'250px',
  marginBottom:'40px'
}

const ContentHeaderStyles={
  display:'flex',
  justifyContent:'center',
  fontWeight:'900',
  color:'orange',
  fontSize:'80px',
  marginTop:'5px',
}

const ContentTitleStyles={
  display:'flex',
  fontWeight:'800',
  color:'black',
  textTransform: 'uppercase',
  fontSize:'20px',
  marginTop:'10px',
}

const ContentIconStyles={
  width:'100px',
  height:'100px'
}

const ContentDescriptionStyles={
  display:'flex',
  fontWeight:'300',
  fontSize:'20px',
  marginTop:'10px',
}


function App() {
  return (
    <div>
     <CardDisplayV
     title={"WE BRING THE BEST THINGS"}
     description={"Embrace a blockchain-powered platform to issue digital certificates, manage training batches, and simplify placement processes."}
     titleStyles={titleStyles}
     subtitleStyles={subtitleStyles}
     cardData={cardData}
     ContentHeaderStyles={ContentHeaderStyles}
     ContentTitleStyles={ContentTitleStyles}
     ContentIconStyles={ContentIconStyles}
     ContentDescriptionStyles={ContentDescriptionStyles}
     />
     <Faq/>
    </div>
  );
}

export default App;
